import SectionTitle from './components/SectionTitle';

function About(){

    return(
        <div>
            <h2>About</h2>
            <div>Name // Takuto Odaira</div>
        </div>
    );

}


export default function Home() {

    return (
        <div>
            <ContentBox>
                <About />
            </ContentBox>
        </div>
    );

}
